import React from 'react';
import './App.css';
import CategoryList from'./components/category';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>HomeCook</h1>
        <CategoryList />

      </header>
    </div>
  );
}

export default App;
